// Creating a new record on the PA Allocation table to assign hrs to resources and tie up to the work assignment request.

var paname = current.pa_assigned;
gs.info("The name of the platform architect assigned is:" + paname);
var worknumber = current.sys_id;
gs.info("The work assignment number is:" + worknumber);
var grallocation = new GlideRecord('x_snc_customer_out_pa_allocations');
grallocation.initialize();
grallocation.setValue('total_hours','8');
grallocation.setValue('name', paname);
grallocation.setValue('work_assignment', worknumber);
grallocation.insert();

